  root: { background: 'red' },
  logo: {
    display: 'none',
  },
});

const hendleScreen = e => {
  console.log(e);
};

class Sidebar extends React.Component {
  state = {
    screen: '',
    menuLow: <DeepMenu />,
  };
  // const classes = useStyles();

  render() {
    return (
      <>
        <Container>
          <div className={{}}>
            <Logo />
          </div>
          <ListMenu />
          {window.onresize(
            this.setState({ screen: document.body.clientWidth })
          )}
        </Container>
      </>
    );
  }
}

export default Sidebar;
